import React from 'react';

class BadgeProfile extends React.Component {
	render() {
		return (
			<div className="container">
				<div className="row">
					<div className="container ">
						<p>FONDO AZUL</p>
					</div>
				</div>
				<div className="row">
					<div className="container">
						<div className="row align-items-start">
							<p>IMAGEN Y NOMBRE</p>
						</div>
						<div className="row row align-items-end-items-start">
							<div className="col">
								<p>
									Tweets <br />9{' '}
								</p>
							</div>
							<div className="col">
								<p>
									FOLLOWING <br />12{' '}
								</p>
							</div>
							<div className="col">
								FOLLOWERS <br />2{' '}
							</div>
						</div>
					</div>
				</div>
			</div>
		);
	}
}
export default BadgeProfile;
